var img = 'data:image/jpeg;base64,'
var doc = new jsPDF()

doc.setFontSize(40)
//x, y, texto, titulo
doc.text(35, 25, 'PDF EXAMPLE')
//variable que alberga la imagen
doc.addImage(img, 'JPEG', 15, 40, 180, 160)
//Guardar el pdf

doc.triangle(80, 80, 299, 200, 100, 300)

doc.save('Example.pdf')
